import React from "react";
import { directive } from "@babel/types";

export default function ProfilePage(user, theme) {
    return (
        <div>
            <section>
                <p><strong>User:</strong>{user.name}*</p>
            </section>
            <section>
            <p><strong>Theme:</strong>{theme.name}*</p>
            </section>
        </div>
    )
}
